import { useNavigate } from "react-router-dom";
import Navbar from "../../components/Navbar/navbar";
import Button from "../../components/Button/button";
import ovo from "../../assets/imagePGI.png";
import Popup from "../../components/Popup/popup";
import logo from "../../assets/logo3.png"; // Using a different image for the tree nodes
import React from "react";
import "./learn.css";
import { useState } from "react";

const Node = ({ x, y, img_node = logo, onClick }) => {
  return (
    <div
      style={{
        position: "absolute",
        left: x,
        top: y,
        width: "120px",
        height: "120px",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        zIndex: 5,
      }}
    >
      <img
        onClick={onClick}
        src={img_node}
        alt="Node"
        style={{
          width: "100px",
          height: "100px",
          objectFit: "cover",
          borderRadius: "15px",
          border: "6px solid black",
          cursor: "pointer",
        }}
      />
    </div>
  );
};

const ConnectionLine = ({ x1, y1, x2, y2 }) => {
  return (
    <svg
      style={{
        position: "absolute",
        top: 0,
        left: 0,
        overflow: "visible",
        zIndex: 0,
      }}
    >
      <line
        x1={x1 + 50} // Adjust for node center
        y1={y1 + 50}
        x2={x2 + 50}
        y2={y2 + 50}
        stroke="black"
        strokeWidth="4"
      />
    </svg>
  );
};


export default function Learn() {
  const [isPopupVisible, setPopupVisible] = useState(false);
  const [rec, setRec] = useState(1);

  const showPopup = (id) => {
    const recipe = recipes.find((r) => r.id === recipeId);
    setSelectedRecipe(recipe);
    setRec(recipe);
    setPopupVisible(true);
  };

  const hidePopup = () => {
    setPopupVisible(false);  // Set popup visibility to false
  };
  const recipes = [
    {
      id: 1,
      title: "Pancakes",
      ingredients: [
        "1 cup all-purpose flour",
        "2 tablespoons sugar",
        "1 tablespoon baking powder",
        "1/2 teaspoon salt",
        "1 cup milk",
        "1 egg",
        "2 tablespoons melted butter",
        "1 teaspoon vanilla extract",
      ],
      instructions: [
        "In a bowl, whisk together the dry ingredients: flour, sugar, baking powder, and salt.",
        "In another bowl, whisk together the wet ingredients: milk, egg, butter, and vanilla extract.",
        "Pour the wet ingredients into the dry ingredients and stir until just combined.",
        "Heat a non-stick skillet over medium heat. Lightly grease it with butter or cooking spray.",
        "Pour 1/4 cup of batter onto the skillet for each pancake. Cook until bubbles form on the surface, then flip and cook until golden brown.",
        "Serve with syrup, fruit, or your favorite toppings.",
      ],
    },
    {
      id: 2,
      title: "Spaghetti Bolognese",
      ingredients: [
        "200g spaghetti",
        "100g ground beef",
        "1 onion, chopped",
        "2 garlic cloves, minced",
        "400g canned tomatoes",
        "1 tablespoon tomato paste",
        "1 teaspoon dried oregano",
        "Salt and pepper to taste",
      ],
      instructions: [
        "Cook the spaghetti according to the package instructions.",
        "In a pan, cook the ground beef until browned. Add the onion and garlic and cook until softened.",
        "Add the canned tomatoes, tomato paste, and oregano. Simmer for 15 minutes.",
        "Season with salt and pepper.",
        "Serve the sauce over the cooked spaghetti.",
      ],
    },
    ];

  return (
    <>
      <Navbar />
      <div className="homepage">
        {/* Render the Popup, passing visibility state and setter */}
        <Popup isPopupVisible={isPopupVisible} setPopupVisible={setPopupVisible} hidePopup={hidePopup} recipe={recipes[rec]} />

        <h1 style={{display:"flex", justifyContent:"center", color:"#f84234"}}>Progride e aprende novas Receitas!</h1>

        <div style={{ position: "relative", margin: "auto", marginTop:"0%", marginLeft:"15%", display:"flex", justifyContent:"center", alignSelf:"center"  }}>
          <Node x={100} y={250} img_node={ovo} onClick={() => showPopup(1)} />
          <Node x={400} y={250} img_node={logo} onClick={() => showPopup(2)} />
          <Node x={800} y={50} img_node={logo} onClick={() => showPopup(3)} />
          <Node x={800} y={250} img_node={logo} onClick={() => showPopup(4)} />
          <Node x={800} y={450} img_node={logo} onClick={() => showPopup(5)} />

          <ConnectionLine x1={100} y1={250} x2={500} y2={250} />
          <ConnectionLine x1={400} y1={250} x2={800} y2={250} />
          <ConnectionLine x1={400} y1={250} x2={800} y2={450} />
          <ConnectionLine x1={400} y1={250} x2={800} y2={50} />
        </div>
      </div>
    </>
  );
}
